import styled from "styled-components";
import Logo from "../assets/logo.svg";

function Pages() {

    return (
        <div>
            <FormContainer>
                <form >
                    <div className='brand'>
                        <img src={Logo} alt="Logo" />
                        <h1>Dowload Informativos</h1>
                    </div>
                    <input
                        type="text"
                        placeholder="Usuário"
                        name="username"
                        min="3"
                    />
                    <input
                        type="password"
                        placeholder="Senha"
                        name="password"
                    />
                    <button type="submit">ENTRAR</button>
                    <span>
                        Não tem registro ? <Link to="/register">Registrar</Link>
                    </span>
                </form>
            </FormContainer >
            <ToastContainer />
        </div>
    );
}

const FormContainer = styled.div`
  height: 100vh;
    width: 100vw;
    display: flex;
    flex-direction: column;
    justify-content: center;
    gap: 1rem;
    align-items: center;
    background-color: #131324;
    .brand {
      display: flex;
      align-items: center;
      gap: 1rem;
      justify-content: center;
      img {
        height: 5rem;
      }
      h1 {
        color: white;
        text-transform: uppercase;
      }
    }
  
    form {
      display: flex;
      flex-direction: column;
      gap: 2rem;
      background-color: #00000076;
      border-radius: 2rem;
      padding: 3rem 5rem;
    }
    input {
      background-color: transparent;
      padding: 1rem;
      border: 0.1rem solid #4e0eff;
      border-radius: 0.4rem;
      color: white;
      width: 100%;
      font-size: 1rem;
      &:focus {
        border: 0.1rem solid #997af0;
        outline: none;
      }
    }
    button {
      background-color: #4e0eff;
      color: white;
      padding: 1rem 2rem;
      border: none;
      font-weight: bold;
      cursor: pointer;
      border-radius: 0.4rem;
      font-size: 1rem;
      text-transform: uppercase;
      &:hover {
        background-color: #4e0eff;
      }
    }
    span {
      color: white;
      text-transform: uppercase;
      a {
        color: #4e0eff;
        text-decoration: none;
        font-weight: bold;
      }
    }
  `;

export default Pages;
